import styled from 'styled-components';

export const Container=styled.div`
    max-width: 1200px;
    margin: 0 auto;
`;
 export const Heading=styled.p`
  font-family: 'BerkeleyStd';
  font-size: 42px;
  line-height: 1.14;
  letter-spacing: 0.5px;
  color: #022737;
 `;
